import React, { useState } from 'react';
import Imagen from '../../../img/home/gato.png'; // Imagen inicial

const ImageToGif = () => {
  const [imageUrl, setImageUrl] = useState(Imagen);

  const handleClick = () => {
    // Reemplaza la URL de la imagen con la URL del GIF
    setImageUrl('data:image/gif;base64,');
  };

  return (
    <div>
      <img className='gif'
        src={imageUrl} // Usa el estado para la URL de la imagen
        alt="Click to generate GIF"
        onClick={handleClick}
        style={{ cursor: 'pointer', width: '150px', height: '150px' }}
      />
    </div>
  );
};

export default ImageToGif;
